import { Component, OnInit } from '@angular/core';
import { ProfileService, Match } from '../../../services/profile.service';

@Component({
  selector: 'app-liked-users',
  template: `
    <div class="liked-users-container">
      <div class="liked-header">
        <h1>Liked Profiles</h1>
        <p class="subtitle">People you've liked</p>
      </div>

      <div class="liked-grid" *ngIf="likedUsers.length > 0">
        <div 
          *ngFor="let match of likedUsers" 
          class="liked-card"
        >
          <div class="card-image">
            <img 
              [src]="match.user.profileImage || getDefaultImage()" 
              [alt]="match.user.name"
            >
            <div class="compatibility-badge">
              {{ match.compatibility }}% Match
            </div>
          </div>

          <div class="card-content">
            <h3>{{ match.user.name }}, {{ match.user.age }}</h3>
            <p class="user-info">{{ match.user.year }} • {{ match.user.major }}</p>
            <p class="user-bio">{{ match.user.bio }}</p>

            <div class="mutual-interests" *ngIf="match.mutualInterests.length > 0">
              <p class="mutual-label">Mutual interests:</p>
              <div class="mutual-tags">
                <span 
                  *ngFor="let interest of match.mutualInterests.slice(0, 3)" 
                  class="mutual-tag"
                >
                  {{ interest }}
                </span>
              </div>
            </div>

            <div class="card-actions">
              <button class="btn btn-outline" (click)="removeLike(match)">
                Remove Like
              </button>
              <button class="btn btn-primary" (click)="startChat(match)">
                Start Chat
              </button>
            </div>
          </div>
        </div>
      </div>

      <div class="no-likes" *ngIf="likedUsers.length === 0 && !isLoading">
        <div class="no-likes-content">
          <h2>No likes yet</h2>
          <p>Start swiping to find people you like!</p>
          <button class="btn btn-primary" (click)="goToMatches()">
            Find Matches
          </button>
        </div>
      </div>

      <div class="loading" *ngIf="isLoading">
        <div class="loading-spinner"></div>
        <p>Loading liked profiles...</p>
      </div>

      <div class="error-message" *ngIf="errorMessage">
        {{ errorMessage }}
      </div>
    </div>
  `,
  styles: [`
    .liked-users-container {
      max-width: 1200px;
      margin: 0 auto;
      padding: 2rem;
    }

    .liked-header {
      text-align: center;
      margin-bottom: 3rem;
    }

    .liked-header h1 {
      color: white;
      font-size: 2.5rem;
      margin-bottom: 0.5rem;
    }

    .subtitle {
      color: rgba(255, 255, 255, 0.8);
      font-size: 1.2rem;
    }

    .liked-grid {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
      gap: 2rem;
    }

    .liked-card {
      background: white;
      border-radius: 20px;
      overflow: hidden;
      box-shadow: 0 10px 30px rgba(0, 0, 0, 0.1);
      transition: transform 0.3s ease;
    }

    .liked-card:hover {
      transform: translateY(-5px);
    }

    .card-image {
      position: relative;
      height: 200px;
      overflow: hidden;
    }

    .card-image img {
      width: 100%;
      height: 100%;
      object-fit: cover;
    }

    .compatibility-badge {
      position: absolute;
      top: 1rem;
      right: 1rem;
      background: rgba(255, 255, 255, 0.9);
      color: #667eea;
      padding: 0.25rem 0.75rem;
      border-radius: 15px;
      font-size: 0.8rem;
      font-weight: 600;
    }

    .card-content {
      padding: 1.5rem;
    }

    .card-content h3 {
      color: #333;
      font-size: 1.3rem;
      margin-bottom: 0.5rem;
    }

    .user-info {
      color: #6c757d;
      font-size: 0.9rem;
      margin-bottom: 1rem;
    }

    .user-bio {
      color: #555;
      line-height: 1.5;
      margin-bottom: 1rem;
    }

    .mutual-interests {
      background: #e8f5e8;
      padding: 1rem;
      border-radius: 10px;
      margin-bottom: 1rem;
    }

    .mutual-label {
      font-size: 0.8rem;
      color: #28a745;
      font-weight: 600;
      margin-bottom: 0.5rem;
    }

    .mutual-tags {
      display: flex;
      flex-wrap: wrap;
      gap: 0.5rem;
    }

    .mutual-tag {
      background: #28a745;
      color: white;
      padding: 0.25rem 0.75rem;
      border-radius: 15px;
      font-size: 0.8rem;
    }

    .card-actions {
      display: flex;
      gap: 1rem;
    }

    .card-actions .btn {
      flex: 1;
      padding: 0.75rem;
      border-radius: 10px;
      font-weight: 600;
      cursor: pointer;
      transition: all 0.3s ease;
    }

    .no-likes {
      display: flex;
      justify-content: center;
      align-items: center;
      min-height: 400px;
    }

    .no-likes-content {
      text-align: center;
      background: white;
      padding: 3rem;
      border-radius: 20px;
      box-shadow: 0 10px 30px rgba(0, 0, 0, 0.1);
    }

    .no-likes-content h2 {
      color: #667eea;
      margin-bottom: 1rem;
    }

    .loading {
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      min-height: 400px;
      color: white;
    }

    .loading-spinner {
      width: 50px;
      height: 50px;
      border: 4px solid rgba(255, 255, 255, 0.3);
      border-top: 4px solid white;
      border-radius: 50%;
      animation: spin 1s linear infinite;
      margin-bottom: 1rem;
    }

    @keyframes spin {
      0% { transform: rotate(0deg); }
      100% { transform: rotate(360deg); }
    }

    .error-message {
      background: #f8d7da;
      color: #721c24;
      padding: 1rem;
      border-radius: 8px;
      text-align: center;
    }

    @media (max-width: 768px) {
      .liked-grid {
        grid-template-columns: 1fr;
      }
      
      .card-actions {
        flex-direction: column;
      }
    }
  `]
})
export class LikedUsersComponent implements OnInit {
  likedUsers: Match[] = [];
  isLoading = false;
  errorMessage = '';

  constructor(private profileService: ProfileService) {}

  ngOnInit() {
    this.loadLikedUsers();
  }

  loadLikedUsers() {
    this.isLoading = true;
    this.errorMessage = '';

    this.profileService.getLikedUsers().subscribe({
      next: (users) => {
        this.likedUsers = users;
        this.isLoading = false;
      },
      error: (error) => {
        this.errorMessage = 'Failed to load liked users. Please try again.';
        this.isLoading = false;
      }
    });
  }

  removeLike(match: Match) {
    // In real app, this would call an API to remove the like
    this.likedUsers = this.likedUsers.filter(u => u.id !== match.id);
  }

  startChat(match: Match) {
    // In real app, this would navigate to chat or create a new chat
    console.log('Starting chat with:', match.user.name);
  }

  goToMatches() {
    // Navigate to matches page
    window.location.href = '/matches';
  }

  getDefaultImage(): string {
    return 'https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?w=400';
  }
}
